OsmAnd приказује фотографије из неколико извора:
\nOpenPlaceReviews - фотографије тачака од интереса;
\nMapillary - слике на нивоу улице;
\nВеб / Викимедија - фотографије тачака од интереса наведене у OpenStreetMap подацима.
